import { Button, Container, Content, Form, Input, Page, Title, Wrapper } from "./styled";

export default function Login() {
  return (
    <Page>
      <Content>
        <Wrapper><Title>Вход</Title>
        <Form>
          <Input placeholder="Логин" />
          <Input placeholder="Пароль" />
          <Container>
            <Button type="submit" $width="126px" $white>
              Войти
            </Button>
            <Button $width="210px">Регистрация</Button>
          </Container>
        </Form></Wrapper>
      </Content>
    </Page>
  );
}
